import { useEffect, useState } from "react";
import API from "../utils/api";
import Navbar from "../components/Navbar";

export default function History() {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    API.get("/file/history").then((res) => setHistory(res.data));
  }, []);

  return (
    <>
      <Navbar />
      <div className="p-10">
        <h1 className="text-3xl font-bold mb-4">Processing History</h1>

        <table className="w-full border bg-white shadow">
          <thead className="bg-gray-200">
            <tr>
              <th className="p-3 border">File</th>
              <th className="p-3 border">Formula</th>
              <th className="p-3 border">Column</th>
              <th className="p-3 border">Lookup</th>
              <th className="p-3 border">Date</th>
              <th className="p-3 border">Result</th>
            </tr>
          </thead>
          <tbody>
            {history.map((item) => (
              <tr key={item._id} className="hover:bg-gray-50">
                <td className="p-2 border">{item.fileName}</td>
                <td className="p-2 border">{item.formula}</td>
                <td className="p-2 border">{item.column}</td>
                <td className="p-2 border">{item.lookupValue || "-"}</td>
                <td className="p-2 border">
                  {new Date(item.createdAt).toLocaleString()}
                </td>
                <td className="p-2 border text-xs">
                  <pre>{JSON.stringify(item.result, null, 2)}</pre>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
}
